import { TopMenu } from "./TopMenu"
import { Logo } from "./Logo"
import { Banner } from "./Banner";
import './Header.css';

export const Header = () => {

    return (
        <header className="header-setting">
            <TopMenu/>
            <Logo/>
            <Banner/>
        </header>
    )

}
